import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to set up the removal test
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.product-card .add-to-cart').first().click();

    // Take screenshot after adding item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();

    // 3. Wait for the cart modal to be visible and find the remove button
    await page.waitForSelector('.cart-item .remove-item', { state: 'visible', timeout: 5000 });

    // Take screenshot of the cart with an item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));

    // 4. Click the remove button to empty the cart
    await page.locator('.remove-item').click();

    // 5. Wait for the "empty cart" message to appear
    await page.waitForSelector('div.empty-cart', { state: 'visible', timeout: 5000 });

    // Take final screenshot of the empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    // Extract the empty cart message for verification
    const emptyCartMessage = await page.locator('div.empty-cart').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        finalCartMessage: emptyCartMessage
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
